class Temp {  double? day;  double? min;  double? max;  double? night;  double? eve;  double? morn;    Temp({      this.day,       this.min,       this.max,       this.night,       this.eve,       this.morn,});  Temp.fromJson(dynamic json) {    day = json['day'];    min = json['min'];    max = json['max'];    night = json['night'];    eve = json['eve'];    morn = json['morn'];  }}